import style from "./ToDo.module.css"

const ToDo = () => {
    return (
        <main className={style['task-content']}>
            <p className={style['to-do']}>To Do</p>
            <div className={style['list-in']}>To Do</div>


        </main>
    )
}

export default ToDo;
